var startTime = performance.now()
var canvas = document.getElementById('canvas'); //apelarea canvasului este salvata in variabila
var ctx = canvas.getContext('2d'); //lucram in 2 dimensiuni
canvas.width = 800; // sunt preluate la fel ca in CSS
canvas.height = 450;

var image = new Image(); // Loading photo
image.onload = BeginMeniu;

//image.src = dog.message; //Nu functioneaza din cauza protocolului de securitate
image.src = 'data:image/jpeg;base64,';

// Pauza de doua secunde
function Pause() {
    return new Promise(resolve => {
        setTimeout(() => {
            resolve('resolved');
        }, 1000);
    });
}

async function BeginMeniu() {

    Grey(image, 4);

    await Pause(); // timeout 1s

    Grey(image, 2.5);

    await Pause(); // timeout 1s

    Grey(image, 1.5);

    await Pause(); // timeout 1s

    Grey(image, 1);

    await Pause(); // timeout 1s
}

// Prelucarea de imagine in alb-negru
function Grey(image, dash) {


    ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
    var scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
    console.log(scannedImage);
    var scannedData = scannedImage.data;
    for (let i = 0 ; i < scannedData.length / dash ; i += 4) // 4 for new pixel
    {
        var total = scannedData[i] + scannedData[i + 1] + scannedData[i + 2]; // rgb
        var averageColorValue = total / 3;

        scannedData[i] = averageColorValue;
        scannedData[i + 1] = averageColorValue;
        scannedData[i + 2] = averageColorValue;
    }
    scannedImage.data = scannedData;
    ctx.putImageData(scannedImage, 0, 0);


    var endTime = performance.now();
    ctx.font = "30px w";
    ctx.strokeText(`${endTime - startTime} milliseconds`, 40 , 30);
}

